import { useState, useEffect } from "react";
import API from "../../api";

export default function AddGuestForm() {
  const [form, setForm] = useState({
    name: "",
    designation: "",
    contact: "",
    image: "",
    description: "",
  });
  const [guests, setGuests] = useState([]);
  const [editingId, setEditingId] = useState(null);

  useEffect(() => {
    fetchGuests();
  }, []);

  const fetchGuests = async () => {
    const res = await API.get("/guests");
    setGuests(res.data);
  };

  const handleChange = (e) =>
    setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (editingId) {
      await API.put(`/guests/${editingId}`, form);
      alert("‚úÖ Guest updated successfully!");
    } else {
      await API.post("/guests", form);
      alert("‚úÖ Guest added successfully!");
    }
    setForm({
      name: "",
      designation: "",
      contact: "",
      image: "",
      description: "",
    });
    setEditingId(null);
    fetchGuests();
  };

  const handleDelete = async (id) => {
    if (window.confirm("Delete this guest?")) {
      await API.delete(`/guests/${id}`);
      alert("üóëÔ∏è Guest deleted!");
      fetchGuests();
    }
  };

  const handleEdit = (guest) => {
    setForm(guest);
    setEditingId(guest._id);
  };

  return (
    <div className="space-y-6">
      <h2 className="text-2xl font-bold">Manage Guests</h2>

      {/* ‚úèÔ∏è Add/Edit Form */}
      <form onSubmit={handleSubmit} className="d-flex flex-column align-items-center gap-3">
        <input
          name="name"
          value={form.name}
          onChange={handleChange}
          placeholder="Guest Name"
          className="w-full p-2 border rounded"
        />
        <input
          name="designation"
          value={form.designation}
          onChange={handleChange}
          placeholder="Designation"
          className="w-full p-2 border rounded"
        />
        <input
          name="contact"
          value={form.contact}
          onChange={handleChange}
          placeholder="Contact Info"
          className="w-full p-2 border rounded"
        />
        <input
          name="image"
          value={form.image}
          onChange={handleChange}
          placeholder="Image URL"
          className="w-full p-2 border rounded"
        />
        <textarea
          name="description"
          value={form.description}
          onChange={handleChange}
          placeholder="Description"
          className="w-full p-2 border rounded"
        />
        <button
          type="submit"
          className={`px-4 py-2 rounded text-white ${
            editingId
              ? "bg-yellow-500 hover:bg-yellow-600"
              : "bg-blue-600 hover:bg-blue-700"
          }`}
        >
          {editingId ? "Update Guest" : "Add Guest"}
        </button>
      </form>

      {/* üìã Guests list */}
      <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-4 mt-5">
        {guests.map((g) => (
          <div
            key={g._id}
            className="bg-white shadow p-4 rounded border border-gray-200"
          >
            {g.image && (
              <img
                src={g.image}
                alt={g.name}
                className="w-full h-40 object-cover rounded mb-2"
              />
            )}
            <h4 className="text-lg font-semibold">{g.name}</h4>
            <p className="text-gray-600">{g.designation}</p>
            <p className="text-gray-500 text-sm mt-1">{g.description}</p>
            <p className="text-gray-400 text-sm mt-1">{g.contact}</p>
            <div className="flex gap-2 mt-2">
              <button
                onClick={() => handleEdit(g)}
                className="bg-yellow-400 hover:bg-yellow-500 px-3 py-1 rounded"
              >
                ‚úèÔ∏è Edit
              </button>
              <button
                onClick={() => handleDelete(g._id)}
                className="bg-red-600 hover:bg-red-700 text-white px-3 py-1 rounded"
              >
                üóëÔ∏è Delete
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
